import React from 'react';
import './HadriansLibrary.scss';

const HadriansLibrary : React.FC = props => {
    return (
        <section className={`one-site hadrian-s-library`} id={`hadrians-library`}>
            <h2>Hadrian's Library</h2>
            <div className={`practical-info`}>
                <b>Time spent there:</b> 25 min<br></br>
                <b>Entrance:</b> <a href='https://goo.gl/maps/aSMdGJG6h32zWH1fA' target='_blank'>here</a>
            </div>
            <div>
                <p>
                    It was a library created by Roman Emperor Hadrian around 100 AC. During Byzantine times, 3 churches have been consecutively built in the middle of the courtyard.
                </p>
                <p>
                    Only a couple of walls and columns remain standing.
                </p>
                <p>
                    The ruins are very visible from outside.
                </p>
            </div>
        </section>
    );
}

export default HadriansLibrary;
